svg.script:
webMI.data.subscribe(webMI.query["base"] + ".current_flow", function(e) {
var id = "id_38";
var value = e.value;
webMI.gfx.setText(id, webMI.sprintf("%.1f", value));

});


webMI.data.read(webMI.query["base"] + ".diameter", function(e) {
var id = "id_7";
var value = e.value;
webMI.gfx.setText(id, value);

});



webMI.data.subscribeBlock([webMI.query["base"] + ".diameter"],[], function(e) {
var id = "id_7";
var value = e[0].value == 0;
if(value==false)
  return;
if (value == true)
	webMI.gfx.setVisible(id, false);

});


webMI.data.subscribeBlock([webMI.query["base"] + ".diameter"],[], function(e) {
var id = "id_14";
var value = e[0].value == 0;
if(value==false)
  return;
if (value == true)
	webMI.gfx.setVisible(id, false);

});


webMI.addEvent("id_1", "click", function(e) {
var id = "id_1";
var value = true;
webMI.display.openWindow({display:"SYSTEM.DISPLAYS.Caudalimetro.graph_caudales",extern:false,height:570,menubar:false,modal:true,movable:true,resizable:true,scrollbars:false,status:false,title:"T{Caudal}",toolbar:false,width:1920,query:webMI.query});
});
